	private void execute_Rule785(StackElement currentElement, StackElement parent) {
		int currentPos = parent.getCurrentSemanticActionPosition();
		if(currentElement==parent){
			switch(currentPos) {
			case 0:
				execute_Rule785_Position0(currentElement);
				break;
			case 1:
				execute_Rule785_Position1(currentElement);
				break;
			case 2:
				execute_Rule785_Position2(currentElement);
				break;
			case 3:
				execute_Rule785_Position3(currentElement);
				break;
			}
		} else {
			switch(currentPos - 1) {
			case 2:
				execute_Rule785_Term2(currentElement, parent);
				break;
			}
		}
	}

